function onLoad() {
    this.i_radius = this.get('inner').getExtent().y/2
    this.o_radius = this.getExtent().y/2
    this.visible = false;
    this.position = 0;
    var self = this;
    this.icons = [];
    this.selectAllSubmorphs(function(ea){
        if(ea.getName().substring(0,3)!=='div')
            self.icons.push(ea);
    });
}

159.source:
function divide(n) {
    this.theta = 360/n;
    for(var i=0; i<n; i++){
        var start = pt(this.i_radius*Math.cos((i*this.theta+90)*Math.PI/180),this.i_radius*Math.sin((i*this.theta+90)*Math.PI/180)),
            end = pt(this.o_radius*Math.cos((i*this.theta+90)*Math.PI/180),this.o_radius*Math.sin((i*this.theta+90)*Math.PI/180));
        this.addDivider(start,end,i);
    }
}

165.source:
function rotate(dir) {
    if(dir=='cw'){
        this.position++;
        this.setRotation(this.getRotation()-this.theta*Math.PI/180)
    }
    else {
        this.position--;
        this.setRotation(this.getRotation()+this.theta*Math.PI/180)
    }
    var self = this;
    this.icons.forEach(function(ea){
        ea.setRotation(-self.getRotation());
    });

}

